import './App.css';
import Homepage from './pages/homepage/Homepage';
import { Routes, Route } from 'react-router-dom';

function App() {

  const HatsPage = () => (
    <div>
      <h1>HATS PAGE </h1>
    </div>
  );

  return (


    <Routes>
      <Route exact path='/' element={<Homepage />} />
      <Route path='/hats' element={HatsPage} />
    </Routes>


  );
}

export default App;
